const Projectdetail = (props) => {
    return(<div>
     "Props check" : {props.data.id}
     "title" :{props.data.title}
     "url"{props.data.url}
     <Link><a href="{props.data.url" target="_blank">DEployment</a></Link>
   </div> )
}
  


export default Projectdetail;
